import React, {Component } from 'react';
import "./style.css";

export default class Home extends Component {
  render() {
    return (
      <div className="home">
        <h1>Bem Vindo</h1>

        <p>Seja bem vindo ao Sunshine web, aqui voce localiza todo os hoteis e resortes da rede Sunshine. Espalhados pelas praias de todo Brasil os hoteis da rede Sunshine ja ganharam 5 premios de melhor do ramo.</p>

        <h2>Confira alguns de nossos hoteis</h2>
      </div>
    )
  }
}
